import "./CardDest.css";
import { Link } from "react-router-dom";
import korbous from "../../Images/korbous/korbous.jpg";

function CardDest(props) {
    // const card1 =style.card1'
    // background: ${(props)=>props.color};
    // ';
    return (
        <div class="col-sm-6 col-md-6 col-lg-3 " style={{backgroundImage:{korbous}}}>
            <Link to="/acceuil" className="mx-4 ">
                <div class="card card1" style={{ borderRadius: "15px" }}>
                    <h5>{props.title}</h5>
                    <p>{props.subtitle}</p>
                </div>
                <img src={korbous}>
                <p>nizar</p>
                </img>
                <Image></Image>
            </Link>
        </div>
    );
}

export default CardDest;
